import React, {Component} from 'react';
import Seo from "./Seo";

class Seoservice extends Component {
    render() {
        return (
            <div>
                <Seo class="skewed" skew="skew1" titleseo="SEO tự động" vtnoidung="" vtanh="" ndseo="Dịch vụ SEO Tự Động - AutoSEO giúp Bạn tận hưởng sự ngọt ngào của SEO với kết quả lên TOP nhanh. Gói này bao gồm: tối ưu onpage, tối ưu mã nguồn trang web, xây dựng liên kết, lựa chọn từ khóa có liên quan và báo cáo phân tích website của Bạn. Khi sử dụng dịch vụ SEO Tự Động với kỹ thuật SEO mũ trắng , trang web của bạn sẽ nhanh chóng lên TOP Google, tăng khả năng tiếp cận khách hàng tiềm năng, cải thiện độ tin cậy của doanh nghiệp và tăng tỷ lệ chuyển đổi. Chúng tôi đảm bảo từ khoá lên TOP nhanh chóng, bền vững, giá cả phải chăng" vtimg="" anhseo="../img/seo3.png"/>
                <Seo class="skewed2" skew="skew2" titleseo="SEO chuyên gia" vtnoidung="order-md-2" vtanh="order-md-1" ndseo="Dịch vụ SEO Tự Động - AutoSEO giúp Bạn tận hưởng sự ngọt ngào của SEO với kết quả lên TOP nhanh. Gói này bao gồm: tối ưu onpage, tối ưu mã nguồn trang web, xây dựng liên kết, lựa chọn từ khóa có liên quan và báo cáo phân tích website của Bạn. Khi sử dụng dịch vụ SEO Tự Động với kỹ thuật SEO mũ trắng , trang web của bạn sẽ nhanh chóng lên TOP Google, tăng khả năng tiếp cận khách hàng tiềm năng, cải thiện độ tin cậy của doanh nghiệp và tăng tỷ lệ chuyển đổi. Chúng tôi đảm bảo từ khoá lên TOP nhanh chóng, bền vững, giá cả phải chăng" vtimg="img-middle" anhseo="../img/seo4.png"/>
                <Seo class="skewed3" skew="skew3" titleseo="SEO từ mã nguồn" vtnoidung="" vtanh="" ndseo="Dịch vụ SEO Tự Động - AutoSEO giúp Bạn tận hưởng sự ngọt ngào của SEO với kết quả lên TOP nhanh. Gói này bao gồm: tối ưu onpage, tối ưu mã nguồn trang web, xây dựng liên kết, lựa chọn từ khóa có liên quan và báo cáo phân tích website của Bạn. Khi sử dụng dịch vụ SEO Tự Động với kỹ thuật SEO mũ trắng , trang web của bạn sẽ nhanh chóng lên TOP Google, tăng khả năng tiếp cận khách hàng tiềm năng, cải thiện độ tin cậy của doanh nghiệp và tăng tỷ lệ chuyển đổi. Chúng tôi đảm bảo từ khoá lên TOP nhanh chóng, bền vững, giá cả phải chăng" vtimg="img-bottom" anhseo="../img/seo3.png"/>
            </div>
        );
    }
}

export default Seoservice;
